クリスマスツリー　120cm クリスマスツリー　ヌードツリー ドイツトウヒツリー
リアルさを追求した立体的なモミの枝で、そのままでも飾れます。<br>
北米でなじみのあるポモナ・ファーというモミの樹を模しています。<br>
ちょっと大人の雰囲気のクリスマスツリーが欲しいならこれです。<br>
オーナメントなしでも十分に趣きのある演出ができます。<br>
組立は非常に簡単です。パーツを脚に挿し込めば枝がパタパタと広がります。
<br>
シーズン終わりもすぐにしまえて効率的です。<br>
ラインナップは120cm/150cm/180cmの3種類。<br>
